import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const styles = {
  title: {
    fontSize: '3rem',
    fontWeight: '900',
    margin: '2vw'
  },
  li: {
    listStyleType: 'none',
    marginLeft: '-1vw',
    fontSize: '1.5rem',
    fontWeight: '600'
  }
};

const Title = props => {
  return (
    <div class="col-12">
      <h1 style={styles.title}>{props.children}</h1>
    </div>
  );
};

const ListItem = props => {
  return (
    <li style={styles.li}>
      <FontAwesomeIcon icon="arrow-right" />
      &ensp; {props.children}
    </li>
  );
};

export { ListItem, Title };
